import React, { useState } from 'react';
import Modal from './Modal';

const Projects = () => {
  const [modalOpen, setModalOpen] = useState(false);
  const [currentImages, setCurrentImages] = useState([]);
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const projects = [
    {
      id: 1,
      title: 'CodeXplore',
      description: 'CodeXplore is your all-in-one mobile coding companion! Learn programming languages like Java through interactive lessons designed for mobile. Practice your knowledge and challenge yourself with a fun quiz mini-game perfect for leveling up your coding skills anytime, anywhere.',
      thumbnail: '/img/CodexLogo2.png',
      tech: ['C#', 'Xamarin', 'SQLite'],
      images: [
        { src: '/img/CodexMain.jpg', caption: 'Home Screen - Modern UI with intuitive navigation' },
        { src: '/img/CodexNavs.jpg', caption: 'App Navigation - Choose and explore the application' },
        { src: '/img/CodexLes.jpg', caption: 'Lesson Preview - Explore basic coding languages' },
        { src: '/img/CodexMainLes.jpg', caption: 'Main Lesson - Study and explore coding' },
        { src: '/img/CodexGame.jpg', caption: 'Game Preview - Pick a mini-game' },
        { src: '/img/CodexMainGame.jpg', caption: 'Mini Game - Test Your Knowledge' },
        { src: '/img/CodexSettings.jpg', caption: 'User Settings - Personalized experience' }
      ]
    },
    {
      id: 2,
      title: 'HxH WebFandom',
      description: 'A dynamic fan website dedicated to Hunter x Hunter anime/manga series. Features include character profiles, story arcs, news updates, and an interactive community section. Built with responsive design principles for optimal viewing across all devices.',
      thumbnail: '/img/FandomLogo.png',
      tech: ['HTML', 'CSS', 'JavaScript'],
      images: [
        { src: '/img/FandomMain.png', caption: 'Home Screen - Modern UI with intuitive navigation' },
        { src: '/img/FandomCategory.png', caption: 'Feature Overview - Key functionalities at a glance' },
        { src: '/img/FandomMainContent.png', caption: 'Main Content - Detailed character information' },
        { src: '/img/FandomNews.png', caption: 'News Section - Latest updates and announcements' }
      ]
    },
    {
      id: 3,
      title: 'Cisco Network',
      description: 'A simple network infrastructure project implementing secure LAN/WAN connectivity, VLAN segmentation, and routing protocols. Designed and simulated using Cisco Packet Tracer.',
      thumbnail: '/img/CiscoTopology.png',
      tech: ['Cisco Packet Tracer'],
      images: [
        { src: '/img/CiscoTopology.png', caption: 'Network Topology - Complete network infrastructure design' },
        { src: '/img/CiscoMiniature.jpg', caption: 'Physical Setup - Hardware configuration and connections' },
        { src: '/img/CiscoTest.jpg', caption: 'Testing Phase - Network performance validation' },
        { src: '/img/CiscoTeam.jpg', caption: 'Team Collaboration - Group implementation process' }
      ]
    }
  ];

  const openModal = (images) => {
    setCurrentImages(images);
    setCurrentImageIndex(0);
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
    setCurrentImages([]);
    setCurrentImageIndex(0);
  };

  const nextImage = () => {
    setCurrentImageIndex((prev) => 
      prev < currentImages.length - 1 ? prev + 1 : prev
    );
  };

  const prevImage = () => {
    setCurrentImageIndex((prev) => prev > 0 ? prev - 1 : prev);
  };

  return (
    <section id="projects" className="projects-section">
      <div className="container">
        <div className="projects-hero-content">
          <h2 className="section-title">My Projects</h2>
          <p className="projects-subtitle">A showcase of my skills and accomplishments.</p>
        </div>

        <div className="grid">
          {projects.map((project) => (
            <article key={project.id} className="project-item">
              <div 
                className="project-gallery"
                onClick={() => openModal(project.images)}
              >
                <img 
                  src={project.thumbnail} 
                  alt={project.title} 
                  className="gallery-trigger"
                />
                <div className="project-overlay">
                  <span>View Gallery</span>
                </div>
              </div>
              <div className="project-info">
                <h3>{project.title}</h3>
                <p>{project.description}</p>
                <div className="project-tech">
                  {project.tech.map((tech, index) => (
                    <span key={index} className="tech-tag">{tech}</span>
                  ))}
                </div>
              </div>
            </article>
          ))}
        </div>
      </div>

      <Modal 
        isOpen={modalOpen}
        onClose={closeModal}
        images={currentImages}
        currentIndex={currentImageIndex}
        onNext={nextImage}
        onPrev={prevImage}
      />
    </section>
  );
};

export default Projects;
